// AgentLists.js
import React, { useEffect, useState } from "react";
import axios from "axios";
import { useParams } from "react-router-dom";

function AgentLists({ token }) {
  const { id } = useParams(); // agent id from route
  const [lists, setLists] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");

  useEffect(() => {
    if (!id) {
      setError("Agent ID is missing");
      setLoading(false);
      return;
    }

    const fetchLists = async () => {
      try {
        const res = await axios.get(`http://localhost:5000/api/csv/agent/${id}`, {
          headers: { Authorization: `Bearer ${token}` },
        });
        setLists(res.data || []);
        setLoading(false);
      } catch (err) {
        console.error(err);
        setError(err.response?.data?.message || "Failed to fetch lists");
        setLoading(false);
      }
    };

    fetchLists();
  }, [id, token]);

  if (loading) return <p>Loading distributed lists...</p>;
  if (error) return <p style={{ color: "red" }}>{error}</p>;

  return (
    <div style={{ maxWidth: "800px", margin: "20px auto" }}>
      <h2>Distributed Lists for Agent</h2>
      {lists.length === 0 ? (
        <p>No items assigned yet.</p>
      ) : (
        <table
          border="1"
          cellPadding="8"
          style={{ width: "100%", borderCollapse: "collapse" }}
        >
          <thead>
            <tr>
              <th>#</th>
              <th>First Name</th>
              <th>Phone</th>
              <th>Notes</th>
            </tr>
          </thead>
          <tbody>
            {lists.map((item, index) => (
              <tr key={index}>
                <td>{index + 1}</td>
                <td>{item.FirstName || item.firstName}</td>
                <td>{item.Phone || item.phone}</td>
                <td>{item.Notes || item.notes}</td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
}

export default AgentLists;
